create table employees (
	id VARCHAR(50),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	company VARCHAR(50),
	total_worth DECIMAL(6,4),
	is_management BOOLEAN,
	country VARCHAR(50)
);






CREATE TABLE country_master (
	country VARCHAR(255),
	continent VARCHAR(255),
	population INTEGER
);



CREATE TABLE continent_master (
	name VARCHAR(255),
	population INTEGER
);

